Mongo embedded document field query<p>I have an existing collection with documents similar to below</p>
<pre><code>{
    &quot;_id&quot; : UUID(&quot;ef2f3778-c74a-4a40-9169-a7798bc6c776&quot;),
    &quot;feedId&quot; : UUID(&quot;677d0a5a-0ceb-43d9-954d-bfefddc22ca2&quot;),
    &quot;events&quot; : {
        &quot;1500&quot; : {
            &quot;t&quot; : ISODate(&quot;2020-08-20T02:25:00.000Z&quot;),
            &quot;a&quot; : {
                &quot;Manager&quot; : &quot;Joe&quot;,
                &quot;Amount&quot; : 20.3
            }
        },
        &quot;1800&quot; : {
            &quot;t&quot; : ISODate(&quot;2020-08-20T02:30:00.000Z&quot;),
            &quot;a&quot; : {
                &quot;Manager&quot; : &quot;Joe&quot;,
                &quot;Amount&quot; : 21.3
            }
        },
        &quot;2100&quot; : {
            &quot;t&quot; : ISODate(&quot;2020-08-20T02:35:00.000Z&quot;),
            &quot;a&quot; : {
                &quot;Manager&quot; : &quot;Joe&quot;,
                &quot;Amount&quot; : 22.3
            }
        },
        &quot;2400&quot; : {
            &quot;t&quot; : ISODate(&quot;2020-08-20T02:40:00.000Z&quot;),
            &quot;a&quot; : {
                &quot;Manager&quot; : &quot;Joe&quot;,
                &quot;Amount&quot; : 23.3
            }
        }
    }
}
</code></pre>
<p>I am interested in a query that returns all the Amount field values ordered in time (the &quot;t&quot; field).  Now, I recognize the &quot;events&quot; embedded document is not structured properly most likely. It should be an array.  But this is the hand dealt I am afraid, i.e. don't have an option to change the documents.  How do I get a query that returns something akin to [20.3, 21.3, 22.3, 23.3, etc.] from all the objects in the collection with the same feedId?</p>
<p>Edit: I'll add that the event objects/documents don't have a uniform name across each collection object.  I.e. here you see 1500, 1800, 2100, etc. this document but the next document may have 1500, and 3000 only.</p>
<p>Reference to another post who had the same question but hit a wall it seems (without changing the document schema to arrays):</p>
<p><a href="https://stackoverflow.com/questions/31178624/mongodb-query-embedded-document-field">MongoDB Query Embedded Document Field</a></p>

