MongoDB cannot get all data<h2>Problem</h2>
<p>I want to fetch all records from my MongoDB collection which have the username or other name in the <code>from or to</code> fields. It is a chat application. I want to fetch all the chats between the user and the other user. It is a schema in a way that when user sends a message their username will get saved in <code>from</code> section, and when they recieve it, their username will get saved in the <code>to</code> section. This is also the same way for the other User.</p>
<p>Please refer to this below:</p>
<h2>On using || in syntax</h2>
<pre><code>getMessages: async(_, { name }, context) =&gt; {
    const user = checkAuth(context);

    if(!user) throw new AuthenticationError('Not logged in');

    const otherUser = await User.findOne({username: name})

    if (!otherUser) throw new UserInputError('User Input Error');

    const messages = await Chat.find({        
        from: otherUser.username || user.username,
        to: user.username || otherUser.username
    }).sort({createdAt: -1})

    return messages
}
</code></pre>
<h3>Output</h3>
<p><a href="https://i.stack.imgur.com/gdgpx.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/gdgpx.png" alt="On || Operator" /></a></p>
<h2>On using &amp;&amp; Operator</h2>
<pre><code>getMessages: async(_, { name }, context) =&gt; {
    const user = checkAuth(context);

    if (!user) throw new AuthenticationError('Not logged in');

    const otherUser = await User.findOne({username: name})

    if (!otherUser) throw new UserInputError('User Input Error');

    const messages = await Chat.find({      // Here is the change
        from: otherUser.username &amp;&amp; user.username,
        to: user.username &amp;&amp; otherUser.username
   }).sort({createdAt: -1})

   return messages
}
</code></pre>
<h3>Output</h3>
<p><a href="https://i.stack.imgur.com/FjRSl.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/FjRSl.png" alt="on &amp;&amp; operator" /></a></p>
<h2>Objective</h2>
<p>I want to get all records between the given user in the <code>name</code> argument and the logged in user. For example between Jahad and Mazino.</p>

