Graphql mongodb cannot return _id<p>Hi everyone I am creating an api with graphql and mongodb. I am using mongodb aggregation to filter my documents.</p>
<pre><code>export const findAllVariants = async (_, { orderby, filter, skip, sort, perPage }, context) =&gt; {
  await jwtAuthentication.verifyTokenMiddleware(context);

  try {
    const aggregate = Variant.aggregate();
    const match = { $and: [] };

    if (filter) {
      await filter.split(' ').forEach((f) =&gt; {
        match.$and.push({
          $or: [
            {
              color: {
                $regex: new RegExp(transliterate(f), 'i')
              }
            },
            {
              size: {
                $regex: new RegExp(transliterate(f), 'i')
              }
            },
            {
              sku: {
                $regex: new RegExp(transliterate(f), 'i')
              }
            },
            {
              barcode: {
                $regex: new RegExp(transliterate(f), 'i')
              }
            }
          ]
        });
      });
      aggregate.match(match);
    }

    const options = {
      allowDiskUse: true,
      limit: perPage,
      page: skip,
      sortBy: { [orderby]: sort }
    };

    return Variant.aggregatePaginate(aggregate, options, (err, results, pageCount, count) =&gt; {
      if (err) {
        return new ApolloError(`There was an error ${err}`);
      }
      console.log(results);
      return {
        count,
        variants: results,
        pageCount,
        skip
      };
    });
  } catch (err) {
    return new ApolloError(`There was an error ${err}`);
  }
};
