<p>If there is a more efficient way to have toppings within the pizza model, pls do share.</p>
<p>GraphQL Types:</p>
<pre><code>    type Topping {
        id: ID!
        name: String!
        price: Float!
        createdAt: String!
    }
    type Pizza {
        id: ID!
        location: String!
        price: Float!
        toppings: [Topping]!
        createdAt: String!
        toppingCount: Int!
    }
</code></pre>
<p>Mongoose Models:</p>
<pre><code>const pizzaSchema = new Schema({
    location: String,
    price: Number,
    toppings: {
        type: Schema.Types.ObjectId,
        ref: &quot;toppings&quot;
