MongoDB modify the array of objects field by element number without findAndModify or update query<p>I have a problem with updating / modifying the Mongoose embed document.</p>
<p>My function iterate over each document in the collection one-by-one via <code>EachASync</code> cursor:</p>
<pre class="lang-js prettyprint-override"><code>//inside async function
.EachASync(async MongoDoc =&gt; { //&lt;= Mongo Document type, not lean!
  //other logic modifiying other fields

  const names = ['name1'] //it could be multiple values


  for (const element of names ) {
    //findIndex in MongoDoc.filter.realms &lt;= array of objects
    const index = MongoDoc.filter.realms.findIndex(realm =&gt; realm.name === element)
    //I want to update the specific object property 'time' inside array by index
    MongoDoc.filter.realms[index].time = Date.now()
  }
  await MongoDoc.save()
}
</code></pre>
<p>Actually I modifying the whole document, but I <strong>also</strong> want to update the specific nested object field, which contains the array of the object field.</p>
<p>The schema for the selected fields:</p>
<pre><code>// Schema
{
  _id: MongoID,
  //many other fields,
  filter: { // &lt;= parent field
    realm: [{ // &lt;= parent object
      name: String,
      time: Number, //the value that I want to update by index
    }]
  }
}

</code></pre>
<h2>Example</h2>
<pre><code>{
  _id: 1,
  filter: {
    realms: [
      {
        name: &quot;name1&quot;, 
        time: 1, //modify this values via it's index number 
        // in this case it's 0
        // via MongoDoc.filter.realms, without updateOne or findAndUpdate
      },
      {
        name: &quot;name2&quot;,
        time: 2,
      },
      {
        name: &quot;name3&quot;,
        time: 3,
      }
    ]
  }
}

</code></pre>
<p>So the question is: How to achieve my results appropriately? Without using <code>findAndUpdate</code> or <code>updateOne</code>? According to <a href="https://docs.mongodb.com/manual/reference/operator/update/positional/" rel="nofollow noreferrer">this article</a>, it's somehow possible.</p>
<p>Also, what's the optimal solution? To update the necessary object value by index? Like:</p>
<pre><code>MongoDoc.filter.realms[index].time = Date.now()
</code></pre>
<p>Or rebuild the whole array of objects, by copy / mutating the original one?</p>

